        return (<Fragment>
            <div className={"feendbackone"}>
                <Input
                    type="textarea"
                    autosize={{ minRows: 2, maxRows: 4}}
                    placeholder="请输入内容"
                />
            <img alt={"微信"} src={require('E:\\baking\\hongpeibang\\src\\img\\qrcode_for_gh_98d29a03a480_860.jpg')}/>
            </div>
        </Fragment>)
    }

}

export default withRouter(feedbackone);
